import "dotenv/config";

import { Equos, type EquosAvatar } from "@equos/node-sdk";

export const DEFAULT_AVATAR: string =
  "data:image/jpeg;base64,";

const client = Equos.client(process.env.EQUOS_API_KEY!);

export const createAvatar = async () => {
  const avatar: EquosAvatar = await client.avatars.create({
    name: "Jeremy",
    identity: "equos-avatar-jeremy",
    refImage: DEFAULT_AVATAR,
  });

  console.log("Avatar created:", avatar.id);

  console.log("Avatar details:");
  console.log(avatar);
};

createAvatar();
